import React from "react";
import { GoogleMap, withScriptjs, withGoogleMap } from "react-google-maps";

const myMap = () => {
  return (
    <GoogleMap
      defaultZoom={10}
      defaultCenter={{
        lat: 33.684566,
        lng: -117.826508,
      }}
    />
  );
};

const wrappedMap = withScriptjs(withGoogleMap(myMap));
export default wrappedMap;
